import styled from 'styled-components';

const MakeRoom = () => {
  return <MakeRoomButton>방만들기</MakeRoomButton>;
};
export default MakeRoom;

const MakeRoomButton = styled.button`
  background-color: #0a0a23;
  color: #fff;
  border: none;
  border-radius: 10px;
  padding: 15px;
  min-height: 30px;
  min-width: 120px;
`;
const MakeRoomButtonFont = styled.div`
  font-size: 20px;
  font-weight: 700;
`;
